import './App.css';
import Home from './Componants/Home/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar from './Componants/Home/Header/NavBar';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
function App() {
    return (
        <div className="App">
            <div>
                <BrowserRouter>
                    <NavBar />
                    <Routes>
                        <Home />
                    </Routes>
                </BrowserRouter>
            </div>
        </div>
    );
}

export default App;
